import React, { useState } from 'react';

const Signup = () => {

  return (
    <div>
      <h1>Signup</h1>
      <form>
        <label>Username</label>
        <input type="text" />
        <label>Email</label>
        <input type="email"  />
        <label>Password</label>
        <input type="password"  />
        <button type="submit">Submit</button>
      </form>
    </div>
  );
};

export default Signup;
